issue.body:
Hi I have been integrating your library with my project and loving it so far. Your support for deep links is brilliant too.

Ive encountered a stumbling block on one of my screens that has a list of generic items that get displayed in a menu of cards/tiles and each can transition to their own view which Id like to have their own Route/Coordinator (each coordinator and its screen will be in their own SPM Package)

Because the cards list is generic it can have any number of conforming items and so their routes cannot be explicitly defined in CardsMenuRoute

Ive tried using generics in the CardsMenuRoute such as below, but Im getting errors here. Perhaps Im struggling as my Swift 5.7 generics isn't up to scratch. But perhaps you know the right way to solve this, or a better way?

```
enum CardsMenuRoute: Route {
    case menuDetail(StrongRouter<any Route>)
}

override func prepareTransition(for route: CardsMenuRoute) -> NavigationTransition {
        switch route {
        case .widget(let cardsMenuRoute):
            return .push(cardsMenuRoute)
        }
    }
```
Cheers

comment.body:
I know that, but you are not actually using the router's functionality anywhere in the example you provided, so it might simply be easier to go one step higher in the inheritance and simply make the associated object of that case a `Presentable`, since that's what is required by `Transition.push`. Or do you need more information about the router than what is part of your example?

What I'm proposing is:

```swift
enum CardsMenuRoute: Route {
    case menuDetail(any Presentable)
}

override func prepareTransition(for route: CardsMenuRoute) -> NavigationTransition {
        switch route {
        case .widget(let cardsMenuRoute):
            return .push(cardsMenuRoute)
        }
    }
```

